import { useState } from "react";
import { GrayButton } from "../styles/Buttons";
import {
  ListFoodBox,
  ListButtonBox,
  ListHandleBox,
  ListHandleButtonBox,
} from "../styles/MyLists";
import {
  ButtonText,
  SerifText,
  SerifTextN,
  SerifTextS,
} from "../styles/TextStyles";
import { List1, ListList } from "../testData/FoodData";
import { generateList } from "./functions/itemList";
import { priceAll } from "./functions/priceAll";

export const MyListsElementBox = (data: any, setData: any) => {
  const [active, setActive] = useState<boolean>(false);
  return ListList.map((item) => (
    <ListHandleBox theme={active}>
      <ListHandleButtonBox onClick={() => setActive(!active)}>
        <SerifText>Title #1</SerifText>
        <SerifText>Value: {priceAll(List1)}</SerifText>
      </ListHandleButtonBox>
      {active ? (
        <ListFoodBox style={{ padding: "10px 10px 10px 0px" }}>
          <ListButtonBox>
            <GrayButton>
              <ButtonText>Delete</ButtonText>
            </GrayButton>
            <GrayButton>
              <ButtonText>Order</ButtonText>
            </GrayButton>
            <GrayButton>
              <ButtonText>test</ButtonText>
            </GrayButton>
          </ListButtonBox>
        </ListFoodBox>
      ) : null}
    </ListHandleBox>
  ));
};
